    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,367.45,231)" ed:parentid="102" id="120">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">默认长度10,调用没有带初始容量的构造函数其实是空数组 当添加第一个元素的时候数组容量</tspan>

        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,367.45,297.75)" ed:parentid="102" id="122">

    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,461.45,275.5)" ed:parentid="122" id="124">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">//我们知道位运算的速度远远快于整除运算，整句运算式的结果就是将新容量更新为旧容量的</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">1.5倍，</tspan>
        </text>
    </g>
    <g ed:width="323" ed:height="21" transform="matrix(1,0,0,1,461.45,320)" ed:parentid="122" id="126">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">int newCapacity = oldCapacity + (oldCapacity >> 1);</tspan>
        </text>
    </g>
    <g ed:width="115.2" ed:height="38" transform="matrix(1,0,0,1,230.25,1173.38)" ed:parentid="101" id="128">
        <path stroke-width="3" stroke="#ffffff" fill="#2da2bf" stroke-linejoin="round" d="M9.5,0L115.2,0L105.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">HashMap</tspan>
        </text>
    </g>
    <g ed:width="70" ed:height="21" transform="matrix(1,0,0,1,372.45,1517.52)" ed:parentid="128" id="130">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">JDK1.8前</tspan>
        </text>
    </g>
    <g ed:width="70" ed:height="21" transform="matrix(1,0,0,1,372.45,1639.27)" ed:parentid="128" id="132">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">JDK1.8后</tspan>
        </text>
    </g>
    <g ed:width="335" ed:height="21" transform="matrix(1,0,0,1,469.45,1459.27)" ed:parentid="130" id="134">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">拉链法 底层是 数组和链表 结合在一起使用也就是 链表散列</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,469.45,1486.77)" ed:parentid="130" id="136">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">通过 key 的 hashCode 经过hash函数处理过后得到 hash 值，然后通过 (n - 1) &amp; hash 判断</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">当前元素存放的位置（这里的 n 指的是数组的长度）,扰动函数减少碰撞 </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,372.45,500)" ed:parentid="128" id="138">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">Node数组,每个node有hash值, key, value, next /   冲突采用“拉链法"：将链表和数组相结</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">合。也就是说创建一个链表数组，数组中每一格就是一个链表。若遇到哈希冲突，则将冲突的</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">值加到链表中即可。</tspan>
        </text>
    </g>
    <g ed:width="438" ed:height="21" transform="matrix(1,0,0,1,469.45,1625.52)" ed:parentid="132" id="140">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">当链表长度大于阈值（默认为8）时，将链表转化为红黑树，以减少搜索时间。 </tspan>
        </text>
    </g>
    <g ed:width="81" ed:height="21" transform="matrix(1,0,0,1,372.45,561.5)" ed:parentid="128" id="142">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">默认容量16</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,372.45,619.75)" ed:parentid="128" id="144">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">加载因子</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,466.45,589)" ed:parentid="144" id="146">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">loadFactor加载因子是控制数组存放数据的疏密程度，loadFactor越趋近于1，那么 数组中存</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">放的数据(entry)也就越多，也就越密，也就是会让链表的长度增加，load Factor越小，也就</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">是趋近于0，</tspan>
        </text>
    </g>
    <g ed:width="365" ed:height="21" transform="matrix(1,0,0,1,466.45,650.5)" ed:parentid="144" id="148">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9"> loadFactor的默认值为0.75f是官方给出的一个比较好的临界值。</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,372.45,678)" ed:parentid="128" id="150">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">扩容</tspan>
        </text>
    </g>
    <g ed:width="280" ed:height="21" transform="matrix(1,0,0,1,442.45,678)" ed:parentid="150" id="152">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">实际size >= 容量 * 加载因子 那么就需要扩容了 </tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,372.45,921.38)" ed:parentid="128" id="154">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">添加元素</tspan>
        </text>
    </g>
    <g ed:width="125" ed:height="21" transform="matrix(1,0,0,1,466.45,705.5)" ed:parentid="154" id="156">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">hash扰动得到index</tspan>
        </text>
    </g>
    <g ed:width="263" ed:height="21" transform="matrix(1,0,0,1,466.45,733)" ed:parentid="154" id="158">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">如果定位到的数组位置没有元素 就直接插入。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,466.45,890.63)" ed:parentid="154" id="160">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">如果key不相同，就判断p是否是一个树节点，如果是就调用e = </tspan>
            <tspan style="white-space:pre" y="31.5" x="9">((TreeNode&lt;K,V>)p).putTreeVal(this, tab, hash, key, value)将元素添加进入。如果不是就</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">遍历链表插入。</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,1008.45,907.63)" ed:parentid="160" id="162">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">图解</tspan>
        </text>

    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,469.45,1553.52)" ed:parentid="130" id="187">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">添加元素</tspan>
        </text>
    </g>
    <g ed:width="279" ed:height="21" transform="matrix(1,0,0,1,563.45,1531.27)" ed:parentid="187" id="189">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">①如果定位到的数组位置没有元素 就直接插入。 </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,563.45,1558.77)" ed:parentid="187" id="191">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">②如果定位到的数组位置有元素，遍历以这个元素为头结点的链表，依次和插入的key比较，</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">如果key相同就直接覆盖，不同就采用头插法插入元素。</tspan>
        </text>
    </g>
    <g ed:width="422" ed:height="21" transform="matrix(1,0,0,1,469.45,1675.27)" ed:parentid="132" id="193">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">红黑树占用空间是普通node的两倍, 所以 节点等于6的时候, 就变成链表结构</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,372.45,1298.27)" ed:parentid="128" id="195">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">扩容</tspan>
        </text>
    </g>
    <g ed:width="119.2" ed:height="38" transform="matrix(1,0,0,1,230.25,401.5)" ed:parentid="101" id="199">
        <path stroke-width="3" stroke="#ffffff" fill="#3498db" stroke-linejoin="round" d="M9.5,0L119.2,0L109.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">LinkedList</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,376.45,382.5)" ed:parentid="199" id="201">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">不是线程安全</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,494.45,374)" ed:parentid="201" id="203">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">如果想使LinkedList变成线程安全的，可以调用静态类Collections类中的synchronizedList方</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">法：List list=Collections.synchronizedList(new LinkedList(...));</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,376.45,418.5)" ed:parentid="199" id="205">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">是一个双向链表</tspan>
        </text>
    </g>
    <g ed:width="267.2" ed:height="38" transform="matrix(1,0,0,1,230.25,2821.5)" ed:parentid="101" id="207">
        <path stroke-width="3" stroke="#ffffff" fill="#527294" stroke-linejoin="round" d="M9.5,0L267.2,0L257.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">List，Set,Map三者的区别及总结</tspan>
        </text>
    </g>
    <g ed:width="150" ed:height="21" transform="matrix(1,0,0,1,663.45,2794)" ed:parentid="513" id="209">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">List：对付顺序的好帮手 </tspan>
        </text>
    </g>
    <g ed:width="414" ed:height="21" transform="matrix(1,0,0,1,840.45,2794)" ed:parentid="209" id="213">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">List接口存储一组不唯一（可以有多个元素引用相同的对象），有序的对象 </tspan>
        </text>
    </g>
    <g ed:width="148" ed:height="21" transform="matrix(1,0,0,1,663.45,2821.5)" ed:parentid="513" id="217">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Set:注重独一无二的性质</tspan>
        </text>
    </g>
    <g ed:width="311" ed:height="21" transform="matrix(1,0,0,1,838.45,2821.5)" ed:parentid="217" id="221">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">不允许重复的集合。不会有多个元素引用相同的对象。 </tspan>
        </text>
    </g>
    <g ed:width="154" ed:height="21" transform="matrix(1,0,0,1,524.45,2857.5)" ed:parentid="207" id="225">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Map:用Key来搜索的专家</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,705.45,2849)" ed:parentid="225" id="229">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">使用键值对存储。Map会维护与Key有关联的值。两个Key可以引用相同的对象，但Key不能</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">重复，典型的Key是String类型，但也可以是任何对象。</tspan>
        </text>
    </g>
    <g ed:width="510" ed:height="21" transform="matrix(1,0,0,1,376.45,446)" ed:parentid="199" id="231">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">虽然可以传入index但是内部是根据传入index是不是超过中点,如果是,从头遍历,否则尾部遍历</tspan>
        </text>
    </g>
    <g ed:width="236.2" ed:height="38" transform="matrix(1,0,0,1,230.25,2939)" ed:parentid="101" id="233">
        <path stroke-width="3" stroke="#ffffff" fill="#eb6d71" stroke-linejoin="round" d="M9.5,0L236.2,0L226.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">Arraylist 与 LinkedList 区别</tspan>
        </text>
    </g>
    <g ed:width="293" ed:height="21" transform="matrix(1,0,0,1,493.45,2920)" ed:parentid="233" id="235">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">ArrayList底层使用数组,查找快O(1),插入删除慢O(n)</tspan>
        </text>
    </g>
    <g ed:width="296" ed:height="21" transform="matrix(1,0,0,1,493.45,2947.5)" ed:parentid="233" id="237">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">LinkedList底层用链表,删除插入快O(1),  查找慢O(n)</tspan>
        </text>
    </g>
    <g ed:width="184" ed:height="21" transform="matrix(1,0,0,1,493.45,2975)" ed:parentid="233" id="239">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">删除添加多的建议用LinkedList</tspan>
        </text>
    </g>
    <g ed:width="204.2" ed:height="38" transform="matrix(1,0,0,1,230.25,3059.75)" ed:parentid="101" id="241">
        <path stroke-width="3" stroke="#ffffff" fill="#b296b8" stroke-linejoin="round" d="M9.5,0L204.2,0L194.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">ArrayList和Vector区别</tspan>
        </text>
    </g>
    <g ed:width="404" ed:height="21" transform="matrix(1,0,0,1,461.45,3029)" ed:parentid="241" id="243">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Vector底层和ArrayList都是Object数组,只是方法都添加了synchronized</tspan>
        </text>
    </g>
    <g ed:width="260.2" ed:height="38" transform="matrix(1,0,0,1,230.25,3216.5)" ed:parentid="101" id="245">
        <path stroke-width="3" stroke="#ffffff" fill="#96a6a6" stroke-linejoin="round" d="M9.5,0L260.2,0L250.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">HashMap 和 Hashtable 的区别</tspan>
        </text>
    </g>
    <g ed:width="159" ed:height="21" transform="matrix(1,0,0,1,517.45,3161.5)" ed:parentid="245" id="247">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashMap是非线程安全的</tspan>
        </text>
    </g>
    <g ed:width="152" ed:height="21" transform="matrix(1,0,0,1,517.45,3189)" ed:parentid="245" id="249">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashTable是线程安全的</tspan>
        </text>
    </g>
    <g ed:width="268" ed:height="21" transform="matrix(1,0,0,1,696.45,3189)" ed:parentid="249" id="251">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">方法基本都经过synchronized修饰,类似Vector</tspan>
        </text>
    </g>
    <g ed:width="388" ed:height="21" transform="matrix(1,0,0,1,517.45,3216.5)" ed:parentid="245" id="253">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashTable是全表加锁性能很差目前淘汰了用ConcurrentHashMap  </tspan>
        </text>
    </g>
    <g ed:width="220.2" ed:height="38" transform="matrix(1,0,0,1,230.25,3866.5)" ed:parentid="101" id="255">
        <path stroke-width="3" stroke="#ffffff" fill="#3498db" stroke-linejoin="round" d="M9.5,0L220.2,0L210.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">HashMap和HashSet区别</tspan>
        </text>
    </g>
    <g ed:width="228" ed:height="21" transform="matrix(1,0,0,1,477.45,3784)" ed:parentid="255" id="257">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">set实现了set接口,map实现了map接口</tspan>
        </text>
    </g>
    <g ed:width="298" ed:height="21" transform="matrix(1,0,0,1,477.45,3811.5)" ed:parentid="255" id="259">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashMap储存键值对	HashSet仅仅存储对象</tspan>
        </text>
    </g>
    <g ed:width="465" ed:height="21" transform="matrix(1,0,0,1,477.45,3839)" ed:parentid="255" id="261">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">使用put(key,value)方法将元素放入map中	使用add(value)方法将元素放入set中  </tspan>
        </text>
    </g>
    <g ed:width="251" ed:height="21" transform="matrix(1,0,0,1,477.45,3866.5)" ed:parentid="255" id="265">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashMap中使用键对象来计算hashcode值</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,477.45,3894)" ed:parentid="255" id="267">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">HashSet使用成员对象来计算hashcode值，对于两个对象来说hashcode可能相同，所以</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">equals()方法用来判断对象的相等性，如果两个对象不同的话，那么返回false</tspan>
        </text>
    </g>
    <g ed:width="291" ed:height="21" transform="matrix(1,0,0,1,477.45,3938.5)" ed:parentid="255" id="269">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashMap比较快，因为是使用唯一的键来获取对象</tspan>
        </text>
    </g>
    <g ed:width="194" ed:height="21" transform="matrix(1,0,0,1,477.45,3966)" ed:parentid="255" id="271">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashSet较HashMap来说比较慢</tspan>
        </text>
    </g>
    <g ed:width="138" ed:height="21" transform="matrix(1,0,0,1,363.45,3594.5)" ed:parentid="482" id="273">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashSet如何检查重复</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,528.45,3472.75)" ed:parentid="273" id="275">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">先计算对象的hashcode值来判断对象加入的位置，同时与其他加入的对象的hashcode值作比</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">较</tspan>
        </text>
    </g>
    <g ed:width="178" ed:height="21" transform="matrix(1,0,0,1,1070.45,3459)" ed:parentid="275" id="277">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">如果没有发现重复,就直接添加</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1070.45,3486.5)" ed:parentid="275" id="279">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">如果发现有相同的Hashcode的对象,调用equals()检查对象是否真的相同,如果相同就不会让加</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">入成功</tspan>
        </text>
    </g>
    <g ed:width="235" ed:height="21" transform="matrix(1,0,0,1,528.45,3694)" ed:parentid="273" id="281">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">hashCode（）与equals（）的相关规定</tspan>
        </text>
    </g>
    <g ed:width="391" ed:height="21" transform="matrix(1,0,0,1,790.45,3658)" ed:parentid="281" id="283">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">如果两个对象相等，则hashcode一定也是相同的,equals方法返回true</tspan>
        </text>
    </g>
    <g ed:width="441" ed:height="21" transform="matrix(1,0,0,1,790.45,3685.5)" ed:parentid="281" id="287">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">两个对象有相同的hashcode值，它们也不一定是相等的,因为可能出现hash冲突</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,790.45,3713)" ed:parentid="281" id="289">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">综上，equals方法被覆盖过，则hashCode方法也必须被覆盖,        因为如果equal相同但是</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">hashcode不同也是可以插入的.</tspan>
        </text>
    </g>
    <g ed:width="81" ed:height="21" transform="matrix(1,0,0,1,528.45,3580.75)" ed:parentid="273" id="293">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">equals（）</tspan>
        </text>
    </g>
    <g ed:width="175" ed:height="21" transform="matrix(1,0,0,1,636.45,3572.25)" ed:parentid="293" id="295">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">判断两个对象的地址是否相等</tspan>
        </text>
    </g>
    <g ed:width="235" ed:height="21" transform="matrix(1,0,0,1,838.45,3558.5)" ed:parentid="295" id="297">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">实际上是比较两个对象是不是同一个对象</tspan>
        </text>
    </g>
    <g ed:width="229" ed:height="21" transform="matrix(1,0,0,1,838.45,3586)" ed:parentid="295" id="299">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">等价于通过“==”去比较这两个对象。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,636.45,3613.5)" ed:parentid="293" id="301">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">可以覆盖类的equals()方法，来让equals()通过其它方式比较两个对象是否相等。通常的做法</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">是：若两个对象的内容相等，则equals()方法返回true；否则，返回fasle。</tspan>
        </text>
    </g>
    <g ed:width="123" ed:height="21" transform="matrix(1,0,0,1,636.45,3531)" ed:parentid="293" id="303">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Object默认是用==</tspan>
        </text>
    </g>
    <g ed:width="197.2" ed:height="38" transform="matrix(1,0,0,1,230.25,4056)" ed:parentid="101" id="305">
        <path stroke-width="3" stroke="#ffffff" fill="#2da2bf" stroke-linejoin="round" d="M9.5,0L197.2,0L187.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">equals() 与 == 的区别</tspan>
        </text>
    </g>
    <g ed:width="276" ed:height="21" transform="matrix(1,0,0,1,454.45,4020)" ed:parentid="305" id="307">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">== : 它的作用是判断两个对象的地址是不是相等</tspan>
        </text>
    </g>
    <g ed:width="199" ed:height="21" transform="matrix(1,0,0,1,757.45,4020)" ed:parentid="307" id="309">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">判断两个对象是不是同一个对象。</tspan>
        </text>
    </g>
    <g ed:width="268" ed:height="21" transform="matrix(1,0,0,1,454.45,4078.25)" ed:parentid="305" id="311">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">equals() : 它的作用也是判断两个对象是否相等</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,749.45,4047.5)" ed:parentid="311" id="313">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">情况1，类没有覆盖equals()方法。则通过equals()比较该类的两个对象时，等价于通</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">过“==”比较这两个对象。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,749.45,4092)" ed:parentid="311" id="315">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">情况2，类覆盖了equals()方法。一般，我们都覆盖equals()方法来两个对象的内容相等；若它</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">们的内容相等，则返回true(即，认为这两个对象相等)。</tspan>
        </text>
    </g>
    <g ed:width="287.2" ed:height="38" transform="matrix(1,0,0,1,230.25,4168.25)" ed:parentid="101" id="317">
        <path stroke-width="3" stroke="#ffffff" fill="#ee7c31" stroke-linejoin="round" d="M9.5,0L287.2,0L277.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">comparable 和 comparator的区别</tspan>
        </text>
    </g>
    <g ed:width="197.2" ed:height="38" transform="matrix(1,0,0,1,230.25,2153.13)" ed:parentid="101" id="319">
        <path stroke-width="3" stroke="#ffffff" fill="#ee7c31" stroke-linejoin="round" d="M9.5,0L197.2,0L187.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">ConcurrentHashMap</tspan>
        </text>
    </g>
    <g ed:width="143" ed:height="21" transform="matrix(1,0,0,1,454.45,2042.26)" ed:parentid="319" id="321">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">JDK1.7 分段数组+链表</tspan>
        </text>
    </g>
    <g ed:width="217" ed:height="21" transform="matrix(1,0,0,1,454.45,2299.88)" ed:parentid="319" id="323">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">JDK1.8 Node数组+链表/红黑二叉树</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,624.45,1975.51)" ed:parentid="321" id="325">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9"> 对整个桶数组进行了分割分段(Segment)，每一把锁只锁容器其中一部分数据，多线程访问容</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">器里不同数据段的数据，就不会存在锁竞争，提高并发访问率。（默认分配16个Segment，</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">比Hashtable效率提高16倍。）</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,698.45,2269.13)" ed:parentid="323" id="327">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">直接用 Node 数组+链表+红黑树的数据结构来实现，并发控制使用 synchronized 和 CAS </tspan>
            <tspan style="white-space:pre" y="31.5" x="9">来操作</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,1166.45,1992.51)" ed:parentid="325" id="329">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">图片</tspan>
        </text>
    </g>

    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,624.45,2122.26)" ed:parentid="321" id="343">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">Segment 实现了 ReentrantLock,所以 Segment 是一种可重入锁，                 扮演锁的角</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">色。HashEntry 用于存储键值对数据。</tspan>
        </text>
    </g>
    <g ed:width="338" ed:height="21" transform="matrix(1,0,0,1,624.45,2094.76)" ed:parentid="321" id="345">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Segment 的结构和HashMap类似，是一种数组和链表结构 </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,698.45,2388.5)" ed:parentid="323" id="347">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">synchronized只锁定当前链表或红黑二叉树的首节点，这样只要hash不冲突，就不会产生并</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">发，效率又提升N倍。</tspan>
        </text>
    </g>
    <g ed:width="440" ed:height="21" transform="matrix(1,0,0,1,544.45,4163)" ed:parentid="317" id="349">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">comparable出自java.lang包 它有一个 compareTo(Object obj)方法用来排序</tspan>
        </text>
    </g>
    <g ed:width="498" ed:height="21" transform="matrix(1,0,0,1,544.45,4190.5)" ed:parentid="317" id="351">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">comparator出自 java.util 包它有一个compare(Object obj1, Object obj2)方法用来排序</tspan>
        </text>
    </g>
    <g ed:width="218" ed:height="21" transform="matrix(1,0,0,1,372.45,1814.02)" ed:parentid="128" id="353">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">HashMap 的长度为什么是2的幂次方</tspan>
        </text>
    </g>
    <g ed:width="204" ed:height="21" transform="matrix(1,0,0,1,617.45,1791.77)" ed:parentid="353" id="355">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">hash%length==hash&amp;(length-1)</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,617.45,1819.27)" ed:parentid="353" id="359">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">hash范围大概是40亿映射空间,所以不可能全部取出来,最好的方法是根据长度取余,因为与(&amp;)</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">操作比较快,而且除数是2的幂次则等价于与其除数减一的与(&amp;)操作,所以是2的幂次方</tspan>
        </text>
    </g>
    <g ed:width="149" ed:height="21" transform="matrix(1,0,0,1,517.45,3244)" ed:parentid="245" id="361">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">hashMap支持null的key</tspan>
        </text>
    </g>
    <g ed:width="214" ed:height="21" transform="matrix(1,0,0,1,442.45,1295.02)" ed:parentid="195" id="363">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">jdk1.7多线程扩容会出现死循环问题 </tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,683.45,1219.77)" ed:parentid="363" id="365">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">扩容是新建一个数组，复制原数据到数组。由于数组下标挂有链表，所以需要复制链表，但是</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">多线程操作有可能导致环形链表,后续的Map.get操作可能会造成无限循环，导致CPU的100%</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">占用。</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,517.45,3271.5)" ed:parentid="245" id="459">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">hashTable计算下标是用 % 取余, 默认容量是11 , hashMap大小固定为2的幂,进行位运算来</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">计算位置</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,372.45,1702.77)" ed:parentid="128" id="462">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">HashMap可以key是null  先寻找数组是否有null的key没有就存到数组的0下标, value也可以</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">是null</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,372.45,1747.27)" ed:parentid="128" id="464">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">里面的hash() 向右平移是为了使低位数据量不同,从而使hash值分布尽量均匀, 之后用 </tspan>
            <tspan style="white-space:pre" y="31.5" x="9">hash&amp;(n-1) 来计算在哪个桶里面</tspan>
        </text>
    </g>
    <g ed:width="226" ed:height="21" transform="matrix(1,0,0,1,624.45,2166.76)" ed:parentid="321" id="466">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">每个 Segment 对象中包含一个计数器 </tspan>
        </text>
    </g>
    <g ed:width="359" ed:height="21" transform="matrix(1,0,0,1,877.45,2166.76)" ed:parentid="466" id="468">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">这样当需要更新计数器时，不用锁定整个ConcurrentHashMap </tspan>
        </text>
    </g>
    <g ed:width="248" ed:height="21" transform="matrix(1,0,0,1,442.45,1192.27)" ed:parentid="195" id="470">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">创建一个新的Node数组长度是原来的两倍 </tspan>
        </text>
    </g>
    <g ed:width="343" ed:height="21" transform="matrix(1,0,0,1,717.45,1192.27)" ed:parentid="470" id="472">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">之后循环旧Node数组, Nodehash&amp;(newLength-1)重新哈希</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,442.45,1397.77)" ed:parentid="195" id="477">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">JDK1.8利用双指针,一个头和一个尾, 检测元素的hash值 &amp; oldCap 与操作的结果是否为0：为</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">0，那么下标还是原来的下标；为1，那么下标等于原来下标加上旧数组长度,放置新数组的高</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">位</tspan>
        </text>
    </g>
    <g ed:width="106.2" ed:height="38" transform="matrix(1,0,0,1,230.25,3527.75)" ed:parentid="101" id="482">
        <path stroke-width="3" stroke="#ffffff" fill="#1bbc9d" stroke-linejoin="round" d="M9.5,0L106.2,0L96.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">HashSet</tspan>
        </text>
    </g>
    <g ed:width="492" ed:height="21" transform="matrix(1,0,0,1,363.45,3342.5)" ed:parentid="482" id="484">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">底层也是hashMap,但是add(对象) 方法不一样,所有元素的value默认一个静态常量object</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="55" transform="matrix(1,0,0,1,363.45,3370)" ed:parentid="482" id="486">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">底层主要是hashset加入的时候调用的是hashMap的put方法,map中如果已经存在了 就会返</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">回这个对象, 如果不存在就返回null.  之后判断  entry == null,  如果是true表示加入成功,  如</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">果false表示已经存在了 加入失败</tspan>
        </text>
    </g>
    <g ed:width="421" ed:height="21" transform="matrix(1,0,0,1,363.45,3431.5)" ed:parentid="482" id="488">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">主要要正确重写equals方法和hashCode方法，以保证放入Set对象的唯一性</tspan>
        </text>
    </g>
    <g ed:width="301" ed:height="21" transform="matrix(1,0,0,1,442.45,1164.77)" ed:parentid="195" id="492">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">在元素个数到达阀值（容量x负载因子）后会进行扩容</tspan>
        </text>
    </g>
    <g ed:width="167" ed:height="21" transform="matrix(1,0,0,1,683.45,1325.77)" ed:parentid="363" id="494">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">假设一个桶有两个元素1->2</tspan>
        </text>
    </g>
    <g ed:width="51" ed:height="21" transform="matrix(1,0,0,1,877.45,1289.77)" ed:parentid="494" id="496">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">线程A</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,955.45,1281.27)" ed:parentid="496" id="498">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">准备将这个桶头结点放入新hash数组的某个下标之前 挂起了                                    ,                   </tspan>
            <tspan style="white-space:pre" y="31.5" x="9">两个指针, e = 1,  next = e.next(2)</tspan>
        </text>
    </g>
    <g ed:width="51" ed:height="21" transform="matrix(1,0,0,1,877.45,1325.77)" ed:parentid="494" id="500">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">线程B</tspan>
        </text>
    </g>
    <g ed:width="455" ed:height="21" transform="matrix(1,0,0,1,955.45,1325.77)" ed:parentid="500" id="502">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">畅通无阻的重新定位hash,遍历着这个链表,一个一个往某个桶开始插入,变成了2->1</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,877.45,1353.27)" ed:parentid="494" id="504">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">这个时候A开始了,对1.next指向桶第一个节点2,然后到下一个2.next - > 1 如果get计算的hash</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">刚好在这个index就会互相循环cpu100%</tspan>
        </text>
    </g>
    <g ed:width="112" ed:height="21" transform="matrix(1,0,0,1,524.45,2807.75)" ed:parentid="207" id="513">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Collection父接口</tspan>
        </text>
    </g>
    <g ed:width="186.2" ed:height="38" transform="matrix(1,0,0,1,230.25,2542)" ed:parentid="101" id="515">
        <path stroke-width="3" stroke="#ffffff" fill="#ffaf00" stroke-linejoin="round" d="M9.5,0L186.2,0L176.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">BlockingQueue接口</tspan>
        </text>
    </g>
    <g ed:width="139" ed:height="21" transform="matrix(1,0,0,1,443.45,2459.5)" ed:parentid="515" id="517">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">所有阻塞队列的父接口</tspan>
        </text>
    </g>
    <g ed:width="138" ed:height="21" transform="matrix(1,0,0,1,443.45,2500.75)" ed:parentid="515" id="519">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">ArrayBlockingQueue</tspan>
        </text>
    </g>
    <g ed:width="151" ed:height="21" transform="matrix(1,0,0,1,608.45,2487)" ed:parentid="519" id="521">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">数组实现的有界阻塞队列</tspan>
        </text>
    </g>
    <g ed:width="369" ed:height="21" transform="matrix(1,0,0,1,608.45,2514.5)" ed:parentid="519" id="523">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">先进先出（FIFO）的原则对元素进行排序。支持公平锁和非公平锁</tspan>
        </text>
    </g>
    <g ed:width="145" ed:height="21" transform="matrix(1,0,0,1,443.45,2555.75)" ed:parentid="515" id="525">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">LinkedBlockingQueue</tspan>
        </text>
    </g>
    <g ed:width="363" ed:height="21" transform="matrix(1,0,0,1,615.45,2542)" ed:parentid="525" id="527">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">链表结构组成的有界队列，此队列的长度为Integer.MAX_VALUE</tspan>
        </text>
    </g>
    <g ed:width="45" ed:height="21" transform="matrix(1,0,0,1,615.45,2569.5)" ed:parentid="525" id="529">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">FIFO</tspan>
        </text>
    </g>
    <g ed:width="148" ed:height="21" transform="matrix(1,0,0,1,443.45,2597)" ed:parentid="515" id="531">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">PriorityBlockingQueue</tspan>
        </text>
    </g>
    <g ed:width="163" ed:height="21" transform="matrix(1,0,0,1,618.45,2597)" ed:parentid="531" id="533">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">线程优先级排序的无界队列</tspan>
        </text>
    </g>
    <g ed:width="145" ed:height="21" transform="matrix(1,0,0,1,443.45,2633)" ed:parentid="515" id="535">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">LinkedBlockingDeque</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,615.45,2624.5)" ed:parentid="535" id="537">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">链表结构组成的双向阻塞队列。队列头部和尾部都可以添加和移除元素，多线程并发时，可以</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">将锁的竞争最多降到一半。</tspan>
        </text>
    </g>
    <g ed:width="74" ed:height="21" transform="matrix(1,0,0,1,934.45,1625.52)" ed:parentid="140" id="539">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">为什么是8</tspan>
        </text>
    </g>
    <g ed:width="331" ed:height="21" transform="matrix(1,0,0,1,1035.45,1603.27)" ed:parentid="539" id="541">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Map主要是为了O(1)获取元素, 如果最差情况下会变成O(n)</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,1035.45,1630.77)" ed:parentid="539" id="543">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">如果数据分布均匀 离散情况理想下,   节点分布符合 泊松分布, 达到8的概率极低 ,机会是不可</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">能事件,</tspan>
        </text>
    </g>
    <g ed:width="112.2" ed:height="38" transform="matrix(1,0,0,1,230.25,2709.25)" ed:parentid="101" id="545">
        <path stroke-width="3" stroke="#ffffff" fill="#dd7195" stroke-linejoin="round" d="M9.5,0L112.2,0L102.7,38L0,38L9.5,0z"/>
        <text class="st57">
            <tspan style="white-space:pre" y="23.5" x="21">TreeMap</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,369.45,2695.5)" ed:parentid="545" id="547">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">有序的key-value集合，它是通过红黑树实现的,也是二叉搜索树,只需要O(log2N)即可找到元</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">素</tspan>
        </text>
    </g>
    <g ed:width="279" ed:height="21" transform="matrix(1,0,0,1,369.45,2740)" ed:parentid="545" id="549">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">希望key按序组织,然后快速得到的 就用TreeMap</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="72" transform="matrix(1,0,0,1,461.45,3056.5)" ed:parentid="241" id="570">
        <text class="st58">
            <tspan style="white-space:pre" y="14.5" x="9">用CopyOnWriteArrayList 效率更高,适用于读多写少,避免读也加锁,  虽然是读写锁, 但是 写入</tspan>
            <tspan style="white-space:pre" y="31.5" x="9">不会阻塞读操作,  只有两个写操作才会需要等待,对于add/set修改的 底层是 对原数组进行复</tspan>
            <tspan style="white-space:pre" y="48.5" x="9">制, 之后对复制数组修改 , 然后将复制数组 复制给新数组,此时用的是ReentrantLock的lock操</tspan>
            <tspan style="white-space:pre" y="65.5" x="9">作, 所以读的时候不在乎是否有写操作,因为读的时候都是对老数组操作</tspan>
        </text>
    </g>
    <g ed:width="278" ed:height="21" transform="matrix(1,0,0,1,816.45,2947.5)" ed:parentid="237" id="572">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">线程不安全, ConcurrentLinkedQueue 线程安全</tspan>
        </text>
    </g>
    <g ed:width="430" ed:height="21" transform="matrix(1,0,0,1,372.45,1863.77)" ed:parentid="128" id="574">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">Collections.synchronizedMap(map) 包装map 就可以让hashMap线程安全</tspan>
        </text>
    </g>
    <g ed:width="508" ed:height="21" transform="matrix(1,0,0,1,829.45,1863.77)" ed:parentid="574" id="576">
        <text class="st58">
            <tspan style="white-space:pre" y="14.4" x="9">这个方法是将map 传入一个SynchronizedMap里面,底层方法就是synchronized修饰了方法</tspan>
        </text>
    </g>
